function findKthLargest(nums: number[], k: number): number {
  let ans = 0;
  const flag = nums.length - k;
  // console.log('flag:', flag);
  // 用快排找到第k个数，然后返回
  const help = (left: number, right: number) => {
    // console.log('left:', left)
    // console.log('right:', right)
    let pivot = nums[left];
    // console.log('pivot:', pivot);
    let l = left - 1;
    let r = right + 1;
    while (l < r) {
      do {
        l++;
      }
      while (pivot > nums[l])
      do {
        r--;
      }
      while (pivot < nums[r])

      if (l < r) {
        // console.log('swap', l, r, nums[l], nums[r]);
        [nums[l], nums[r]] = [nums[r], nums[l]]
      }
    }
    if (l === flag) {
      ans = pivot;
      console.log(nums)
      return
    } else if (l < flag) {
      help(l + 1, right);
    } else {
      help(left, l - 1);
    }
  }
  help(0, nums.length - 1)

  return ans;
};

