// 堆排序实现
function findKthLargest2(nums: number[], k: number): number {
  const heap: number[] = [];
  const n = nums.length;
  // 初始化一个k大的数组
  for (let i = 0; i < k; i++) {
    heap.push(nums[i]);
  }

  const parent = (child: number) => Math.floor((child - 1) / 2)

  const siftDown = (i: number) => {
    let p = i;
    while (true) {
      let maxPos = p;
      const left = p * 2 + 1;
      if (left < k && heap[maxPos] > heap[left]) {
        maxPos = left;
      }

      const right = p * 2 + 2;
      if (right < k && heap[maxPos] > heap[right]) {
        maxPos = right;
      }
      if (maxPos !== p) {
        [heap[p], heap[maxPos]] = [heap[maxPos], heap[p]]
        p = maxPos;
      } else {
        break;
      }
    }
  }

  for (let i = parent(k - 1); i >= 0; i--) {
    siftDown(i)
  }

  for (let i = k; i < n; i++) {
    if (heap[0] < nums[i]) {
      heap[0] = nums[i];
      siftDown(0)
    }
  }
  return heap[0];
}


// 实现一个长度为k的小顶堆
function findKthLargest3(nums: number[], k: number): number {

  const heap: number[] = [nums[0]];

  for (let i = 1; i < nums.length; i++) {
    const num = nums[i];
    if (heap.length === k) {
      if (num > heap[0]) {
        heap[0] = num;
        // heap 从顶向下排序
        let i = 0
        while (true) {
          let pos = i;
          const left = i * 2 + 1;
          const right = i * 2 + 2;
          while (left < k && heap[pos] > heap[left]) {
            pos = left
          }
          while (right < k && heap[pos] > heap[right]) {
            pos = right
          }
          if (i !== pos) {
            [heap[i], heap[pos]] = [heap[pos], heap[i]];
            i = pos
          } else {
            break;
          }
        }
      }
    } else {
      heap.push(num);
      // heap 从底向上排序
      let i = heap.length - 1
      while (i > 0) {
        const p = Math.round(i / 2) - 1;
        // console.log('p:', p, heap[i], heap[p])
        // console.log('heap s', heap)
        if (heap[i] < heap[p]) {
          [heap[i], heap[p]] = [heap[p], heap[i]];
          // console.log('heap e', heap)
          i = p
        } else {
          break;
        }
      }
    }
    // console.log(heap)
  }
  // console.log(heap)

  return heap[0];
};

// 快速排序解法
function findKthLargest4(nums: number[], k: number): number {
  let l = 0;
  let r = nums.length
  const target = nums.length - k
  // console.log('target:', target)

  while (true) {
    const pivot = nums[l];
    // console.log('pivot:', pivot, l, r);
    let j = l + 1
    for (let i = l + 1; i <= r; i++) {
      // console.log('i:', i)
      if (nums[i] < pivot) {
        if (i !== j) {
          [nums[i], nums[j]] = [nums[j], nums[i]];
        }
        j++;
      } else if (nums[i] === pivot) {
        j++
      }
      // console.log('j:', j)
    }
    if (nums[l] !== nums[j - 1]) {
      [nums[l], nums[j - 1]] = [nums[j - 1], nums[l]];
    }
    console.log(nums);
    console.log('j - 1', j - 1, l, nums[j - 1], pivot);
    if (j - 1 === target) {
      // console.log(nums)
      return nums[j - 1];
    } else if (j - 1 > target) {
      if (j - 1 !== l && nums[l] === pivot) {
        console.log('r = Math.floor((target + j - 2) / 2)')
        r = Math.floor((target + j - 2) / 2)
      } else {
        r = j - 2
      }
      // console.log('j - 1 > target', nums[j - 1], target, r)
    } else {
      if (j - 1 !== l && nums[l] === pivot) {
        console.log('l = Math.floor((target + j) / 2)')
        l = Math.floor((target + j) / 2)
      } else {
        l = j
      }
      // console.log('else', l)
    }
  }
}

