function findKthLargest8(nums: number[], k: number): number {
  const n = nums.length;
  let left = 0;
  let right = n - 1;
  const target = n - k;

  while (true) {
    const pivotIndex = Math.round(Math.random() * (right - left)) + left;
    [nums[left], nums[pivotIndex]] = [nums[pivotIndex], nums[left]];
    const pivot = nums[left];
    let l = left + 1;
    let r = right;
    while (true) {
      while (l <= r && nums[l] < pivot) {
        l++;
      }
      while (l <= r && nums[r] > pivot) {
        r--;
      }
      if (l >= r) {
        break;
      }
      // console.log('l:', l, ', r:', r);
      [nums[l], nums[r]] = [nums[r], nums[l]];
      r--;
      l++;
    }
    [nums[left], nums[r]] = [nums[r], nums[left]];
    // console.log(nums, left, r, pivot)
    if (target === r) {
      break;
    } else if (target > r) {
      left = r + 1;
    } else {
      right = r - 1;
    }
  }
  // console.log(nums)
  return nums[target];
}

